import { createAppContainer } from 'react-navigation'
import { createStackNavigator } from 'react-navigation-stack'

import Login from './src/Login'
import Sync from './src/Sync'
import Faenas from './src/Faenas'
import vehiculoFaena from './src/vehiculoFaena'
import detalleVehiculo from './src/detalleVehiculo'

const AppNavigator = createStackNavigator({
  Login: {
    screen: Login,

    navigationOptions: {
      title: 'Ingresar',
      headerTintColor: '#fff',
      headerShown: false,
      headerBackTitleVisible: false,
    },
  },

  Sync: {
    screen: Sync,

    navigationOptions: {
      title: 'Faenas',
      headerTintColor: '#fff',
      headerShown: false,
      headerBackTitleVisible: false,
    },
  },

  Faenas: {
    screen: Faenas,

    navigationOptions: {
      title: 'Faenas',
      headerTintColor: '#fff',
      headerShown: false,
      headerBackTitleVisible: false,
    },
  },

  VehiculoFaena: {
    screen: vehiculoFaena,

    navigationOptions: {
      title: 'Vehiculos de la Faena',
      headerTintColor: '#fff',
      headerShown: false,
      headerBackTitleVisible: false,
    },
  },

  DetalleVehiculo: {
    screen: detalleVehiculo,

    navigationOptions: {
      title: 'Detalle del Vehiculo',
      headerTintColor: '#fff',
      headerShown: false,
      headerBackTitleVisible: false,
    },
  },

  //* render de otra pantalla.
},{
  initialRouteName: 'Login',
  defaultNavigationOptions: {
    headerStyle:{
      backgroundColor: '#fff',
    },
    headerTintColor: '#fff',
  }
})

export default createAppContainer(AppNavigator)
